// Function to display suggestions
function displaySuggestions(query) {
  suggestionsList.innerHTML = ''; // Clear previous suggestions
  const filteredSuggestions = [];
  // Extract unique terms from your data, including group names
  const uniqueTerms = new Set();
  for (const groupName in data) {
    // Extract group prefixes (like "TKA", "INB", "FUL")
    const groupPrefix = groupName.split("_")[0].trim().toLowerCase();
    uniqueTerms.add(groupPrefix); // Add group prefix
    uniqueTerms.add(groupName.trim().toLowerCase()); // Add full group name
    data[groupName].forEach(text => {
      text.split(" ").forEach(term => uniqueTerms.add(term.trim().toLowerCase()));
    });
  }
  // Filter unique terms based on the query
  uniqueTerms.forEach(term => {
    if (term.includes(query.toLowerCase())) {
      filteredSuggestions.push(term);
    }
  });
  filteredSuggestions.forEach(suggestion => {
    const suggestionItem = document.createElement('li');
    suggestionItem.textContent = suggestion;
    suggestionItem.addEventListener('click', () => {
      // Determine if the suggestion is a group name or a term
      if (Object.keys(data).includes(suggestion.toUpperCase())) {
        // If it's a group name, update input with group name
        searchInput.value = suggestion;
      } else {
        // If it's a term, try to find the group name associated with it
        for (const groupName in data) {
          if (data[groupName].includes(suggestion.toUpperCase())) {
            searchInput.value = groupName + " - " + suggestion;
            break;
          }
        }
      }
      suggestionsList.style.display = 'none'; // Hide the dropdown
    });
    suggestionsList.appendChild(suggestionItem);
  });
  if (filteredSuggestions.length > 0) {
    suggestionsList.style.display = 'block';
  } else {
    suggestionsList.style.display = 'none';
  }
}
// Event listener for input changes
searchInput.addEventListener('keyup', () => {
  const query = searchInput.value;
  displaySuggestions(query);
});
// Perform search and add spin animation to the logo
const performSearch = () => {
  logoImage.classList.add('spin');
  setTimeout(() => {
    logoImage.classList.remove('spin');
  }, 1000);
  const query = searchInput.value.trim().toLowerCase();
  if (query) {
    resultsList.innerHTML = '';
    let resultsFound = false;
    for (const groupName in data) {
      const normalizedGroupName = groupName.toLowerCase();
      const matchingTexts = data[groupName].filter(text => text.toLowerCase().includes(query));
      if (normalizedGroupName.includes(query) || matchingTexts.length > 0) {
        resultsFound = true;
        const groupHeader = document.createElement('li');
        groupHeader.classList.add('group-header');
        groupHeader.textContent = groupName;
        resultsList.appendChild(groupHeader);
        if (normalizedGroupName.includes(query)) {
          data[groupName].forEach(text => {
            const resultItem = document.createElement('li');
            resultItem.classList.add('result');
            resultItem.textContent = text;
            resultsList.appendChild(resultItem);
          });
        } else {
          matchingTexts.forEach(text => {
            const resultItem = document.createElement('li');
            resultItem.classList.add('result');
            resultItem.textContent = text;
            resultsList.appendChild(resultItem);
          });
        }
      }
    }
    if (!resultsFound) {
      const noResults = document.createElement('li');
      noResults.classList.add('result');
      noResults.textContent = "No matching results found.";
      resultsList.appendChild(noResults);
    }
  }
};
searchButton.addEventListener('click', performSearch);
searchInput.addEventListener('keydown', (event) => {
  if (event.key === 'Enter') {
    performSearch();
  }
});
refreshButton.addEventListener('click', () => location.reload());